import React from "react";
import './playstore.css'

function PlayStore() {
  return (
    <Container sx={{
        height: "60px",
        backgroundColor: "#e3f2fd",
        marginTop: "10px",
    }} className="container">

    </Container>
  );
}

export default PlayStore;
